import { BrowserRouter, Route, Switch, Redirect } from 'react-router-dom';
import App from "./App";
import Login from "./components/login";
import About from "./components/Router/about";
import Navbar from "./components/Router/navbar";
import UserManagement from "./components/Router/user-management";

export default function Main({location}) {
    const [loggedIn, setLoggedIn] = useState(
        // initial value
        document.cookie.split(';').some((item) => item.trim().startsWith('logedIn=')));
    return (



        <BrowserRouter>
            <div className="App">
            <Navbar {...{loggedIn}} />
                { sessionStorage.getItem('username') ?  <Navbar></Navbar> : undefined }
                <Switch>
                <Route exact path='/login' render={
          (routeProps) => <LogIn {...{setLoggedIn, ...routeProps}} />
        } />
                    <Route exact path='/' component={Login}></Route>
                    <Route path='/home' component={App} />
                    <Route path='/about' component={About} />
                    <Route path='/user' component={UserManagement} />
                    <Route path='/logout' component={Login}></Route>


                </Switch>
            </div>
        </BrowserRouter>
    )
}
